import React from 'react';
import {EditText} from "react-edit-text";

function AddChoice(props) {
    return (
        <div className={"radio-option row"}>
            <label className="container">
                <input disabled={true} type="radio" name="radio" value={props.value} name={props.name}/>
                <span className="checkmark"/>
            </label>
            <div
                      className={"radio-text"}> Add Option or add Another </div>

        </div>
    );
}

export default AddChoice;
